export default function FixedIcons() {
    return (
        <div className="icon-cointainer">
            <a href="facebook.com"><i class="fa-brands fa-linkedin-in">LinkedIn</i></a>
            <a href="#"><i class="fa-brands fa-github">GitHub</i></a>
            <a href="#"><i class="fa-solid fa-envelope">Contact me</i></a>
        </div>
    )
}
